The fn key receives the main act function, we write this function for that: const addCountry: ActFn = async (body) => { const { name, population, abb } = body.details.set; return await countries.insertOne({ doc: { name, population, abb, }, projection: body.details.get, });
}; This function receives an input called body, the body of the request sent from the client side is passed to it when this function is called, as a result, we have access to the information sent by users. The request body sent from the client side should be a json like this: { "service": "main", "model": "country", "act": "addCountry", "details": { "set": { "name": "Iran", "population": 85000000, "abb": "IR" }, "get": { "_id": 1, "name": 1, "population": 1, "abb": 1 } }
} The service key is used to select one of the microservices set on the application. You can read more about this here. The model key is used to select one of the models added to the application. The act key is used to select one of the acts added to the application. The act key is used to select one of the acts added to the application. The details key is used to receive data to be sent from the client side along with data to be delivered to users. This key has two internal keys called get and set, we talked a little about it before. set: It contains the information we need in the main function. For this reason, we can extract name, population, and abb from within body.details.set. get: Contains selected information that the user needs to be returned. Therefore, we can pass this object directly to Mongo projection. As you can see, we have used the insertOne function, which was exported from the countries model, to add a new document. This function accepts an object as input, which has the following keys: { doc: OptionalUnlessRequiredId<InferPureFieldsType>; relations?: TInsertRelations<TR>; options?: InsertOptions; projection?: Projection;
} The doc key receives an object of the pure values of the selected model. OptionalUnlessRequiredId type is the document type in the official MongoDB driver. You can read about it here . The relations key receives an object from the relations of this model. There is no relationship here. We will read about this in the next section. The options key gets the official MongoDB driver options to insertOne. You can read more about this here The projection key is used to receive written data. We use native projection in MangoDB. You can read MongoDB's own documentation here . In insertOne, you can only penetrate one step in relationships. Here you can get only pure fields because there is no relation. We will read more about this later.

