As we said before, we embed all relationships. So when you define a relation we store the pure fields of both models in each other. So far we have defined only one model, let us add the second model. We add the following code to the previous codes to add a new model called city. const cityPure = { name: string(), population: number(), abb: string(),
}; const cityRelations = { country: { optional: false, schemaName: "country", type: "single" as RelationDataType, relatedRelations: { cities: { type: "multiple" as RelationDataType, limit: 50, sort: { field: "_id", order: "desc" as RelationSortOrderType, }, }, }, },
}; const cities = coreApp.odm.newModel( "city", cityPure, cityRelations,
); We talked about newModel and its input here . Now we only talk about the third input, the relation definition. which receives an object with string key which is the feild name and we store the relation data by this name inside each document, and TRelation value (relations: Record<string, TRelation>;) which gave us some metadata about the relation. The TRelation type is as follows: export type RelationDataType = "single" | "multiple"; export type RelationSortOrderType = "asc" | "desc"; export type TRelatedRelation = { type: RelationDataType; limit?: null | number; sort?: { field: string; order: RelationSortOrderType };
}; interface TRelation { schemaName: string; type: RelationDataType; optional: boolean; sort?: { field: string; order: RelationSortOrderType; }; relatedRelations: { [key: string]: TRelatedRelation; };
} The schemaName key receives the exact name of another schema to establish a relation. The type key specifies whether the relationship type should be single or multiple. The optional key specifies whether or not it is mandatory to enter information about this relationship when importing a new document. The sort key is optional and specifies that if the relationship type is multiple, based on which field of the relationship schema, the information should be arranged. This key receives an object with two keys: The field that receives the name of one of the schema fields in the relation. An order that receives the value of asc and desc and specifies whether the arrangement should be from bottom to top or vice versa. relatedRelations key that specifies the effects of this schema on the other side of the relationship. This key receives the value of the object with the following keys: The type key specifies whether the relationship type should be single or multiple. limit which specifies the number of relations to be kept if the relation type is multiple. The sort key is optional and specifies that if the relationship type is multiple, based on which field of the relationship schema, the information should be arranged. This key receives an object with two keys: The field that receives the name of one of the schema fields in the relation. An order that receives the value of asc and desc and specifies whether the arrangement should be from bottom to top or vice versa.

