}; const addCity: ActFn = async (body) => { const { country, name, population, abb } = body.details.set; return await cities.insertOne({ doc: { name, population, abb }, projection: body.details.get, relations: { country: { _ids: new ObjectId(country), relatedRelations: { cities: true, }, }, }, });
