}); We need to import objectIdValidation and ObjectId from lesan We see Validator and Act and setAct and insertOne functions before, Here we are only talking about the relations input in the insert function. The type of this input is as follow: export type TInsertRelations<T extends IRelationsFileds> = { [mainKey in keyof T]?: { _ids: ObjectId | ObjectId[]; relatedRelations?: { [key in keyof T[mainKey]["relatedRelations"]]: boolean; }; };
}; This input receives an object with the key name of the relations that we have previously defined in the model. This object has the following keys: ids which receives either an ObjectId or an array of ObjectIds. relatedRelations, which receives an object with the key of the name of the related relations that we have previously defined in the model along with a boolean value. If the value is true, in addition to the given relationship being saved in this new document, this created document is also saved in the related relationship. And if it is false, the relationship will be saved only in this new document. Here, by adding a city and giving the country ID associated with that city, we store both the pure fields of that country in this newly created city, and within that country in an array of objects, we also store the pure fields of this city.

