}; All country relationships do not end here. This schema also has a relationship with the province and city. With one simple question, we can complete the country’s relationships: Is the number of provinces that we are going to keep inside the country too high? (i.e., if it is an SQL database, do we store the province key inside the country?) Answer: No, the number of provinces is limited and we can store all provinces inside the country schema. So this relationship is also inrelation. Therefore, the above object should be created in this way: countryInrelations = { capital: { schemaName: "city", type: "one", optional: false }, provinces: { schemaName: "province", type: "many", optional: true },
}; Another relationship we have in the country is the city, how do we define it? There are many cities in a country and we cannot store all the cities in a country schema. So this is a complicated relationship with a large number, we define it as outrelation that the process of defining it requires more information to know exactly what amount and what data we are going to embed, we add that information in the sort key. countryOutrelation = { cities: { schemaName: "city", number: 50, sort: { field: "_id", order: "desc", type: "objectId" }, },
}; We also define the remaining fields of the country that are specific to it and are not related to any relationship as pure fields. countryPure: { name: string(), abb: optional(string()), ... } For the province, it is the same way: provinceInrelations = { center: { schemaName : "city", type: "one" }, country: { schemaName: "country", type: "one" }}
