}], Now the user can filter and receive all the fields of a schema along with the first depth of its relations by sending only one request to the database. This request is performed based on the process of projection in MongoDB according to the values of fields being one or zero. Without our framework having any involvement in this process. And without us writing an additional layer to filter the requested fields in it. (The process and form of this request will be explained later.) If the lower fields of a country’s schema are requested in a request, not only all the requested information will be received and returned to the user with one request to the server but also with one request to the database. If the following fields are requested from the schema of a country in a request. Not only with a single request to the server but also with a single request to the database, all requested information will be received and returned to the user: getCountry → id: 1 Name: 1 abb: 1 decsription: 1 capital → id: 1 name: 1 abb : 1 provinces → id :1 name : description : 1 cities → id : 1 name : 1 abb : 1 If a user penetrates more than one level of depth, what should be done? For example, if they request provinces for a country, they may also want its cities from within the provinces. Let’s examine what happens in SQL databases before we explain the Lisan framework solution: First of all, we run a query to find the country, because we have the country ID, we run an indexed query. After that, we run a query to find the capital, because we have its ID stored in the country, we run an indexed query. Then we send a query to find the first paginate of provinces. If we have stored the ID of all the provinces of a country inside it, we run an indexed query. Otherwise, we must send an unindexed query with the country ID filter found. Continuing with the example, if we had found 35 of the first paginate provinces. We should send a non-index query with a province ID filter for each one on each city and find the first paginated cities for each of the provinces. (For example, 50 for each province, which means 50 times 30) Finally, to find the first paginate cities for this country too, we need to send a non-index query with the ID filter of the found country on the city table You saw that the process was very complicated in SQL, now let’s see how the same process is done in Lesan . In the previous section, we mentioned that to get a country along with the first depth of its relationships (i.e., capital, states, and cities), we only send an indexed query to the schema of the country and receive all the information. Now we only need to receive information about cities for each province. To do this, while we have access to the information of the provinces, we send an indexed query to receive the provinces again. Because of the concept of outrelation, we are sure that the information of cities is stored within provinces. Therefore, by receiving the provinces again, we will also receive the information of cities. This will have two advantages for us. First, instead of sending a non-index query to the city, we send an index query to the province because we have received the province IDs in the first query.The second advantage is that instead of receiving a large number of cities, we have only received a few provinces. (For example, in SQL, the number of requested documents from the database is equal to 1 + 1 + (35 * 50) + 50. But in the Lesan method, only 1 + 35 documents have been requested.) Now imagine what would happen if more depth and relationships were requested? This is the Achilles' heel of projects written with GraphQL.

