To create a model in Lesan, it can be expanded based on another extensive model so that it has nothing more than that and can only have some of its keys. Therefore, we can create a database for all services along with all models that have all the necessary keys in all services. Then each service defines its own model separately based on the integrated database model and takes some of its required keys from that main model. Given the way models are written in Lesan (model implementation based on a schema validator), we can have a common database and at the same time each service can validate its own data based on the expanded model of the comprehensive and original model. Also, it is possible to move models and actions written in Lesan, and we can easily have each service’s database separately or simultaneously with other services. On the other hand, NoSQL databases are usually schemaless and any shape or form can be given to data in the database. Lesan is currently developed based on MongoDB. If we can put all service models in a comprehensive database, we can prevent data duplication and we no longer need to write parallel logic to manage this duplication. In addition, we do not need any tools for synchronization or writing separate logic to standardize data. Finally, we can also take advantage of the ease of horizontal distribution of NoSQL databases without worrying about data consistency. Consider the following example: Suppose we have several services named core - ecommerce - blog and so on, all of which have a model for users named user. We can create a model of the user that has all the fields of all these services and share it among all services, like this: import { any, array, boolean, date, enums, InRelation, number, object, optional, OutRelation, string,
} from "../../../deps.ts"; export const level = enums(["Admin", "Editor", "Author", "Ghost", "Normal"]);
export const gender = enums(["Male", "Female"]); export const addressObj = object({ addressId: string(), countryId: string(), stateId: string(), cityId: string(), addressText: string(), location: optional( object({ type: string(), coordinates: array(array(number())), }) ),
}); export const pureUserObj = { _id: optional(any()), name: string(), age: number(), lastName: string(), phone: number(), gender: gender, birthDate: optional(date()), postalCode: string(), level: array(level), email: optional(string()), isActive: optional(boolean()), creditCardNumber: optional(number()), address: optional(array(addressObj)),
}; export const userInRel: Record<string, InRelation> = {};
// TODO how c
export const userOutRel: Record<string, OutRelation> = { blogPosts: { schemaName: "blogPosts", number: 50, sort: { type: "objectId", field: "_id", order: "desc" }, }, orders: { schemaName: "order", number: 50, sort: { type: "objectId", field: "_id", order: "desc" }, },
}; Now, for example, we create a model of the user for ecommerce as well and write its fields in such a way that it does not have anything more than the shared user model, like this: import { ecommerceApp } from "../../../../../apps/ecommerce/mod.ts";
import { any, array, boolean, date, InRelation, number, optional, OutRelation, string,
} from "../../../deps.ts"; import { addressObj, gender, level, pureUserObj as sharedPureUserObj, userInRel as sharedUserInRel, userOutRel as sharedUserOutRel,
} from "../../shared/mod.ts"; const userPureObj: Partial<typeof sharedPureUserObj> = { _id: optional(any()), name: string(), age: number(), lastName: string(), phone: number(), gender: gender, birthDate: optional(date()), postalCode: string(), level: array(level), email: optional(string()), isActive: optional(boolean()), creditCardNumber: optional(number()), address: optional(array(addressObj)),
}; const userInRel: Partial<typeof sharedUserInRel> = {}; const userOutRel: Partial<typeof sharedUserOutRel> = { // blogPosts: { // schemaName: "blogPosts", // number: 50, // sort: { type: "objectId", field: "_id", order: "desc" }, // }, orders: { schemaName: "order", number: 50, sort: { type: "objectId", field: "_id", order: "desc" }, },
}; export const users = () => ecommerceApp.odm.setModel( "user", userPureObj, userInRel as Record<string, InRelation>, userOutRel as Record<string, OutRelation> ); Now we can connect them to a common database while several services continue their work independently, provided that the data validation of the schemas works independently for each service and only understands its own data. You can see a complete example of this type of microservice implementation here.

